  true,\n\t\"url\": null,\n\t\"notes\": \"The Building Energy Data Book (2011) is
  a compendium of data from a variety of data sets and includes statistics on residential
  and commercial building energy consumption. Data tables contain statistics related
  to construction, building technologies, energy consumption, and building characteristics.
  \ The Building Technologies Office (BTO) within the U.S. Department of Energy's
  Office of Energy Efficiency and Renewable Energy developed this resource to provide
  a comprehensive set of buildings- and energy-related data.rnrn###The Data Book has
  not been updated since 2011.###rnrnThe data sets comprising the Data Book are now
  publicly available in user-friendly formats and you can use them to find data relevant
  to your questions. Please find below a list of Energy Information Administration
  (EIA) data sets that BTO consults:rnrn*   [Annual Energy Outlook](http://www.eia.gov/forecasts/aeo/)rnrn
  \   Projections in the Annual Energy Outlook 2015 (AEO2015) focus on the factors
  expected to shape U.S. energy markets through 2040.rnrn*   [Monthly Energy Review](http://www.eia.gov/totalenergy/data/monthly/index.cfm#consumption)rn
  \   rn    A publication of recent and historical energy statistics.rnrn*   [Residential
  Energy Consumption Survey (RECS)](http://www.eia.gov/consumption/residential/)rnrn
  \   A nationally representative sample of housing units that specially trained interviewers
  collect energy characteristics, usage patterns, and household demographics.rnrn*
  \  [Commercial Buildings Energy Consumption Survey (CBECS)](http://www.eia.gov/consumption/commercial/)rnrn
  \   A national sample survey that collects information on the stock of U.S. commercial
  buildings, including their energy-related building characteristics and energy usage
  data.rnrnQuestions about the above resources can be [directed to the relevant EIA
  subject matter expert](http://www.eia.gov/about/contact/).\",\n\t\"license_title\":
